import { NavLink } from 'react-router-dom'
export const Navbar = () => {
  const navLinkStyles = ({ isActive }) => {
    return {
      color: isActive ? '' : '#153C00',
      fontWeight: isActive ? 'bold' : 'normal',
      textDecoration: isActive ? 'none' : 'none',
      margin: isActive ? '20px' : '30px'
    }
  }
  const navLinkStylesLout = ({ isActive }) => {
    return {
      color: isActive ? '#153C00' : '#153C00',
      fontWeight: isActive ? 'bold' : 'normal',
      textDecoration: isActive ? 'none' : 'none',
      margin: isActive ? '20px' : '30px',
      top: isActive? '5px' : '5px'
    }
  }
  return (
    <nav className='navbar navbar-expand-lg' id='Navbar'>
      <NavLink to='/' style={navLinkStyles}>
        <h3>Home</h3>
      </NavLink>

      <NavLink to='/popular' style={navLinkStyles}>
        <h3>Popular</h3>
      </NavLink>
      <NavLink to='/yourPerfil' style={navLinkStyles}>
        <h3>Profile</h3>
      </NavLink>
      <NavLink to='/login' style={navLinkStyles}>
        <h3>Login</h3>
      </NavLink>
      <NavLink to='/' id='logout' style={({ isActive }) => ({
              color: isActive ? '#153C00' : '#153C00',
              fontWeight: isActive ? 'bold' : 'normal',
              textDecoration: isActive ? 'none' : 'none',
            })}>
        <h3>Logout</h3>
      </NavLink>
    </nav>
  )
}
export default Navbar
